import './LandingPage.css';

const LandingPage = () => {
    return (
        <div>
            <header className="header">
                <h2 className="heading-primary">Welcome to ReactReads</h2>
                <p>Your place on web to store your precious book finds</p>
            </header>
        </div>
    );
}

export default LandingPage;
